package com.logicbuilding;

public class SwapTwoNumbersSol1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10;
		int b=20;
		System.out.print("a= "+a);
		System.out.print("b= "+b);
	int	temp=a;//temp=10
	a=b;//a=20
	b=temp;
	System.out.print("a= "+a);
	System.out.print("b= "+b);
	
	
		

	}

}
